    return <div>
        <Header />
        {notes.map((noteItem)=>{
            return (<Note 
                        key={noteItem.key} 
                        title={noteItem.title} 
                        content={noteItems.content} 
                    />);
        })}
        <Footer />
    </div>
}
export default App;
